    this.state = {
      console: this.props.console
    };
    this.renderLines = this.renderLines.bind(this)
  }

  static getDerivedStateFromProps(props, state) {
      console.log(props)
    if (props.console !== state.console) {
      return {
        console: props.console
      };
    }
    return null;
  }

  renderLines(){
      return this.state.console.join("\n")
  }

